Information
------------------------------
In July 1865, four English, one French and two Swiss explorers successfully climbed the Matterhorn for the first time. On the way down, four climbers fell to their deaths. The survivors became suspects. Was it an accident, sabotage or murder? A team attempts the same climb 150 years after to solve the mystery.

